import React from "react"

import videoCargando from "../foto/videos/videoCargando.mp4"
import ReactPlayer from "react-player"
function Cargando(){
    return(
       
      <div className="load">
         <ReactPlayer
          url={videoCargando}
          height="0%"
          width='60%'
          controls
          playing
          playbackRate={1.75}
          className="react-player"        
          />

        </div>
    )
}

export default Cargando
